import { Link } from "react-router-dom";
import "../css/header/header.css";
export const Header = ({ date }) => {
  return (
    <header clasName="login-page">
      <a href="https://www.freepik.com/vectors/food">
        Food vector created by rawpixel.com - www.freepik.com
      </a>
      <div className="login-page__row">
        <div className="login-page__column"></div>
        <div className="login-page__column">
          <h1 className=""> Hamburger App</h1>
        </div>
        <div className="login-page__column">
          <Link className="" to="/login">
            {" "}
            Login
          </Link>
          <Link className="" to="/register">
            {" "}
            Register
          </Link>
        </div>
      </div>
      <span className="">{date}</span>
    </header>
  );
};
